<script>
import axios from 'axios'
var Qs = require('qs');
import { mapMutations ,mapState} from 'vuex'
export default {
    name:'login',
    data:function(){
        return {
            userName:'',
            password:''
        }
    },
    computed:{
        ...mapState(['user'])
    },
    methods:{
        ...mapMutations(['setUser']),
        login(){
            var _this = this;
            axios({
                method: 'post',
                url: '/signin',
                data: Qs.stringify({
                    name: _this.userName,
                    password: _this.password
                })
            })
            .then((res)=>{
                console.log(res);
                var data = res.data;
                
                if(data.code==='0'){
                    this.setUser(data.result);
                    window.localStorage.setItem('user',JSON.stringify(data.result))
                    _this.$router.push('/personalShow')
                }else{
                    alert('err')
                }
            })
        },
        register(){
            var _this = this;
            axios({
                method: 'post',
                url: '/signup',
                data: Qs.stringify({
                    name: _this.userName,
                    password: _this.password
                })
            })
            .then((res)=>{
                var data = res.data;
                
                if(data.code=='0'){
                    this.setUser(data.result);
                    window.localStorage.setItem('user',JSON.stringify(data.result))
                    _this.$router.push('/personalShow')
                }else{
                    alert('err')
                }
            })
        }
    }
}
</script>
